import './App.css';
import { Routes, Route, Outlet, Link } from 'react';

function App() {
  return (
    <div className="App">
      <h1>라우터 연습</h1>
      {/* path = 가상 url, element = 컴포넌트*/}

      <Routes>
        <Route path="/" element={<Layout />} />
        {/* 전체적인 라우터 골격은 Layout 컴포넌트에 놓는다 */}
        <Route index element={<Home />} />
        <Route path="about" element={<About />} />
      </Routes>
    </div>
  );
}

export default App;
